#############################################

draw_menu:
	li $t0, BASE_ADDRESS
    	li $t3, 0                # Initialize loop counter
    	la $t2, menu_screen           # Load base address of colors array
    	jal loop
    	j game_loop	

main: 
	jal draw_lvl_1
	jal draw_cat_right
	jal game_loop
	
##################### DRAWING ####################
draw_lvl_1:
	la $t0, lvl
    	lw $t2, 0($t0)
    	li $t2, 1
    	sw $t2 0($t0)
	
	li $t0, BASE_ADDRESS
    	li $t3, 0                # Initialize loop counter
    	la $t2, lvl_1_array           # Load base address of colors array
    	j loop
    	
draw_lvl_2:
	li $t0, BASE_ADDRESS
    	li $t3, 0                # Initialize loop counter
    	la $t2, lvl_2_array           # Load base address of colors array
    	
    	jal loop
    	
    	la $t0, x #set x to the lvl 2 starting position
    	li $t1, 3
    	sw $t1, 0($t0)
   	la $t0, y #set y to the lvl 2 starting position
    	li $t1, 54
    	sw $t1, 0($t0)
    	
    	jal draw_cat_right
    	
    	la $t0, hearts
    	lw $t2, 0($t0)
    	li $t2, 3
    	sw $t2 0($t0)
    	
    	jal game_loop
    	
draw_lvl_3:
	li $t0, BASE_ADDRESS
    	li $t3, 0                # Initialize loop counter
    	la $t2, lvl_3_array           # Load base address of colors array
    	
    	jal loop
    	
    	la $t0, x #set x to the lvl 3 starting position
    	li $t1, 9
    	sw $t1, 0($t0)
   	la $t0, y #set y to the lvl 3 starting position
    	li $t1, 6
    	sw $t1, 0($t0)
    	
    	jal draw_cat_right
    	
    	la $t0, hearts
    	lw $t2, 0($t0)
    	li $t2, 3
    	sw $t2 0($t0)
    	
    	jal game_loop
    
loop:
    lw $t6, 0($t2)           # Load color from colors array
    sw $t6, 0($t0)           # Store color to base address
    addi $t3, $t3, 1         # Increment loop counter
    addi $t2, $t2, 4         # Move to next color in colors array
    addi $t0, $t0, 4         # Move to next pixel in display buffer
   
    bne $t3, 4096, loop     # Check loop counter, if not finished, repeat
    jr $ra

draw_cat_right:
    addi $sp $sp, -4
    sw $ra 0($sp)

    la $t0, x
    lw $t0, 0($t0)
    move $a0, $t0
    la $t0, y
    lw $t0, 0($t0)
    move $a1, $t0

    jal get_x_y

    move $t0, $v0
    la $t1, CATCOLOUR
    lw $t1, 0($t1)

    sw $t1 0($t0) #draw pixel
    sw $t1 4($t0) #draw left stomache
    sw $t1 8($t0) #draw right stomahe
    sw $t1 12($t0) #draw bottom chest
    sw $t1 256($t0) #draw back foot
    sw $t1 268($t0) #draw right foot
    sw $t1 -512($t0) #draw bototm of tail
    sw $t1 -256($t0) #draw but
    sw $t1 -252($t0) #draw left back
    sw $t1 -248($t0) #draw right back
    sw $t1 -244($t0) #draw chest
    sw $t1 -516($t0) #draw middle of tail 
    sw $t1 -772($t0) #draw middle of tail
    sw $t1 -1028($t0) #draw top of tail 
    sw $t1 -1024($t0) #draw top of tail 
    sw $t1 -500($t0) #draw bottom of head
    sw $t1 -504($t0) #draw left of head
    sw $t1 -496($t0) #draw right of head
    sw $t1 -756($t0) #draw top of head
    sw $t1 -760($t0) #draw top left of head
    sw $t1 -752($t0) #draw top right of head
    sw $t1 -1016($t0) #draw left ear
    sw $t1 -1008($t0) #draw right ear

    lw $ra 0($sp)
    addi $sp, $sp 4
    jr $ra 

draw_cat_left:
    addi $sp $sp, -4
    sw $ra 0($sp)


    la $t0, x
    lw $t0, 0($t0)
    move $a0, $t0
    la $t0, y
    lw $t0, 0($t0)
    move $a1, $t0

    jal get_x_y

    move $t0, $v0
    la $t1, CATCOLOUR
    lw $t1, 0($t1)

    sw $t1 0($t0) #draw pixel
    sw $t1 4($t0) #draw left stomache
    sw $t1 8($t0) #draw right stomahe
    sw $t1 12($t0) #draw bottom chest
    sw $t1 256($t0) #draw front foot
    sw $t1 268($t0) #draw back foot
    sw $t1 -500($t0) #draw bottom of tail
    sw $t1 -256($t0) #draw but
    sw $t1 -252($t0) #draw left back
    sw $t1 -248($t0) #draw right back
    sw $t1 -244($t0) #draw chest
    sw $t1 -496($t0) #draw middle of tail 
    sw $t1 -752($t0) #draw middle of tail
    sw $t1 -1008($t0) #draw top of tail 
    sw $t1 -1012($t0) #draw top of tail 
    sw $t1 -512($t0) #draw bottom of head
    sw $t1 -516($t0) #draw left of head
    sw $t1 -508($t0) #draw right of head
    sw $t1 -768($t0) #draw top of head
    sw $t1 -772($t0) #draw top left of head
    sw $t1 -764($t0) #draw top right of head
    sw $t1 -1028($t0) #draw left ear
    sw $t1 -1020($t0) #draw right ear

    lw $ra 0($sp)
    addi $sp, $sp 4
    jr $ra 

clear_cat:
    addi $sp $sp, -4
    sw $ra 0($sp)

    la $t0, x
    lw $t0, 0($t0)
    move $a0, $t0
    la $t0, y
    lw $t0, 0($t0)
    move $a1, $t0

    jal get_x_y

    move $t0, $v0
    la $t1, BACKGROUNDCOLOUR
    lw $t1, 0($t1)
	
    sw $t1 0($t0) #draw pixel     RIGHTCAT
    sw $t1 4($t0) #draw left stomache
    sw $t1 8($t0) #draw right stomahe
    sw $t1 12($t0) #draw bottom chest
    sw $t1 256($t0) #draw left foot
    sw $t1 268($t0) #draw right foot
  
    
    sw $t1 -512($t0) #draw bototm of tail
    sw $t1 -256($t0) #draw but
    sw $t1 -252($t0) #draw left back
    sw $t1 -248($t0) #draw right back
    sw $t1 -244($t0) #draw chest
    sw $t1 -516($t0) #draw middle of tail 
    sw $t1 -772($t0) #draw middle of tail
    sw $t1 -1028($t0) #draw top of tail 
    sw $t1 -1024($t0) #draw top of tail 
    sw $t1 -500($t0) #draw bottom of head
    sw $t1 -504($t0) #draw left of head
    sw $t1 -496($t0) #draw right of head
    sw $t1 -756($t0) #draw top of head
    sw $t1 -760($t0) #draw top left of head
    sw $t1 -752($t0) #draw top right of head
    sw $t1 -1016($t0) #draw left ear
    sw $t1 -1008($t0) #draw right ear

    sw $t1 -1012($t0) #draw top of tail  LEFTCAT
    sw $t1 -508($t0) #draw right of head
    sw $t1 -768($t0) #draw top of head
    sw $t1 -764($t0) #draw top right of head
    sw $t1 -1020($t0) #draw right ear
    
    lw $ra 0($sp)
    addi $sp, $sp 4
    jr $ra 

get_x_y:
    li $t2, BASE_ADDRESS
    li $t3, 63
    sub $t3, $t3, $a1
    li $t4, 64
    mul $t3, $t3, $t4
    sll $t3, $t3, 2
    sll $a0, $a0, 2
    add $t3, $t3, $a0
    add $t3, $t3, $t2

    move $v0, $t3
    jr $ra
######################################################

############### MAIN LOOPS #############################
game_loop: 
	jal choose_spikes_lvl

	la $t0 is_jump
	lw $t2 0($t0)
	beq $t2, 1, check_height
	beq $t2, 0, check_for_keypress
	
	j game_loop
	
check_for_keypress:
	li $t9, 0xffff0000
	lw $t8, 0($t9)	
	beq $t8, 1, keypress_happened
	
	j game_loop
	
check_height:
	la $t0 height
    	lw $t2 0($t0)
    	beq $t2, 9, gravity #if we reached the max height, start to go down
    	blt $t2, 9, check_top_collision #if we didnt reach the max height, keep going up
    	jr $ra
#########################################################
    	
################ JUMPING #############################
jump_type:
	la $t0, jump_begin
    	lw $t2, 0($t0)
    	
    	beq $t2, 0, jump_up #normal jump
    	beq $t2, 1, jump_up_single #beggining of single jump
    	beq $t2, 2, jump_up_double #beggining of double jump
    	
jump_up:
	jal clear_cat
	
	la $t0 y  #move up one
	lw $t2 0($t0)
	addi $t2, $t2, 1
	sw $t2 0($t0)
	
	la $t0 height  # increase height
	lw $t2 0($t0)
	addi $t2, $t2, 1
	sw $t2 0($t0)
	
    	# jal draw_cat_jump
    	jal draw_cat_right
    	
    	li $v0, 32
	li $a0, 100 # Wait one second (1000 milliseconds) 
	syscall
    	
    	j check_for_keypress
    	
 jump_up_single:
 	la $t0 jump_begin  # reset, triggered on by button press
	lw $t2 0($t0)
	li $t2, 0
	sw $t2 0($t0)
	
	jal clear_cat
	
	la $t0 y  #move up two
	lw $t2 0($t0)
	addi $t2, $t2, 1
	sw $t2 0($t0)
	
	la $t0 height  # increase height
	lw $t2 0($t0)
	addi $t2, $t2, 1
	sw $t2 0($t0)
	
    	# jal draw_cat_jump
    	jal draw_cat_right
    	
    	j check_for_keypress
    	
 jump_up_double:
 	la $t0 jump_begin  # reset, triggered on by button press
	lw $t2 0($t0)
