	beq $t4, 1, return
	
	la $t0 lvl
	lw $t2 0($t0)
	beq $t2, 1, animate_spikes_1
	beq $t2, 2, animate_spikes_2
	beq $t2, 3, animate_spikes_3
	jr $ra
	
