###################### GRAVITY ###############################
gravity:
	la $t0, x  # for first leg
    	lw $t0, 0($t0)
    	move $a0, $t0
    	
    	la $t0, y
    	lw $t2, 0($t0)
    	addi $t2, $t2, -2 # subtract 2 from the y to get the floor
    	sw $t2 0($t0)
    	move $a1, $t2

    	jal get_x_y
    	
    	move $t0, $v0 
    	lw $t5, 0($t0) #get value of the pixel (hex code)
    	##############
    	la $t0, x   # for second leg
    	lw $t2, 0($t0)
    	addi $t2, $t2, 3 # add 2 for the right body part
    	sw $t2 0($t0)
    	move $a0, $t2
    	
    	la $t0, y
    	lw $t0, 0($t0)
    	move $a1, $t0

    	jal get_x_y
    	
    	move $t0, $v0 
    	lw $t7, 0($t0) #get value of the pixel (hex code)
    	###############
    	la $t0, x   # for left bottom
    	lw $t2, 0($t0)
    	addi $t2, $t2, -4
    	sw $t2 0($t0)
    	move $a0, $t2
    	
    	la $t0, y
    	lw $t2, 0($t0)
    	addi $t2, $t2, 3
    	sw $t2 0($t0)
    	move $a1, $t2

    	jal get_x_y
    	
    	move $t0, $v0 
    	lw $t9, 0($t0) #get value of the pixel (hex code)
    	##############
    	la $t0, x   # for right bottoom
    	lw $t2, 0($t0)
    	addi $t2, $t2, 5
    	sw $t2 0($t0)
    	move $a0, $t2
    	
    	la $t0, y
    	lw $t2, 0($t0)
    	move $a1, $t2

    	jal get_x_y
    	
    	move $t0, $v0 
    	lw $t8, 0($t0) #get value of the pixel (hex code)
    	##############
    	la $t0, x
    	lw $t2, 0($t0)
    	addi $t2, $t2, -4
    	sw $t2 0($t0)
    	
    	la $t0, y
    	lw $t2, 0($t0)
    	addi $t2, $t2, -1
    	sw $t2 0($t0)
    
    	
    	la $t2, SPIKESCOLOUR
    	lw $t6, 0($t2) #get the value of the spikes
    	
    	beq $t5, $t6, take_damage #if left foot lands on spikes, go into function
    	beq $t7, $t6, take_damage
    	
    	la $t2, VINESCOLOUR
    	lw $t6, 0($t2) #get the value of the vines
    	
    	beq $t5, $t6, take_damage #if left foot lands on spikes, go into function
    	beq $t7, $t6, take_damage
    	
    	la $t2, BACKGROUNDCOLOUR
    	lw $t6, 0($t2) #get the value of the background
    	
    	bne $t5, $t6, stop_gravity #left foot  #checking if the floor under the left foot is the background colour
    	bne $t7, $t6, stop_gravity #right foot
    	bne $t8, $t6, stop_gravity #right side
    	bne $t9, $t6, stop_gravity #left side
    	
    	beq $t5, $t6, move_down
    	beq $t7, $t6, move_down
  	
  	j check_for_keypress
  	
move_down:
	jal clear_cat
	
	la $t0 y
	lw $t2 0($t0)
	addi $t2, $t2, -1
	sw $t2 0($t0)
    
    	#jal choose_right_animation
    	jal draw_cat_right
    	
    	li $v0, 32
	li $a0, 100 # Wait one second (1000 milliseconds) 
	syscall
    	
    	j check_for_keypress

stop_gravity:
	la $t0 is_jump  #reset is_jump to 0
	lw $t2 0($t0)
	li $t2, 0
	sw $t2 0($t0)
	
	la $t0 height  #reset height to 0
	lw $t2 0($t0)
	li $t2, 0
	sw $t2 0($t0)
	
	la $t0 double_jump  #reset double_jump to 0
	lw $t2 0($t0)
	li $t2, 0
	sw $t2 0($t0)
	
	j check_for_keypress
##########################################################
	
########### MANGAGE HEARTS ############################
take_damage:
	la $t0, hearts
    	lw $t5, 0($t0)
    	
    	beq $t5, 3, erase_heart_3
    	beq $t5, 2, erase_heart_2
    	beq $t5, 1, erase_heart_1
    	
	j game_loop
	
erase_heart_3:
	addi $sp $sp, -4
    	sw $ra 0($sp)
	
	la $t0 heart3x
	lw $t0 0($t0)
	move $a0, $t0
	
	j erase_heart
	
erase_heart_2:
	addi $sp $sp, -4
    	sw $ra 0($sp)
	
	la $t0 heart2x
	lw $t0 0($t0)
	move $a0, $t0
	
	j erase_heart

erase_heart_1:
	addi $sp $sp, -4
    	sw $ra 0($sp)
	
	la $t0 heart1x
	lw $t0 0($t0)
	move $a0, $t0
	
	j erase_heart
	
erase_heart:
	la $t0 hearty
	lw $t0 0($t0)
	move $a1, $t0

    	jal get_x_y

    	move $t0, $v0
    	la $t1, GROUNDCOLOUR
    	lw $t1, 0($t1)

    	sw $t1 0($t0) #draw pixel
    	sw $t1 -4($t0) #draw left
    	sw $t1 4($t0) #draw right
    	sw $t1 -260($t0) #draw top left
    	sw $t1 -252($t0) #draw top right
    	sw $t1 256($t0) #draw bottom
    	
    	la $t0, hearts
    	lw $t5, 0($t0)
    	addi $t5, $t5, -1 # decrease hearts by 1
	sw $t5 0($t0)
	
	beq $t5, 0, lose_screen # we lost all our hearts
    	lw $ra 0($sp)
   	addi $sp, $sp 4
   	
   	jal clear_cat

	la $t0, lvl
    	lw $t5, 0($t0)
    	
    	beq, $t5, 1, reset_1
    	beq, $t5, 2, reset_2
    	beq, $t5, 3, reset_3
    	
	j stop_gravity
