######## LOSE AND WIN SCREENS ###################
lose_screen:
	li $t0, BASE_ADDRESS
    	li $t3, 0                # Initialize loop counter
    	la $t2, lose_screen_array     
    	jal loop
    	
    	la $t0 dead
	lw $t4 0($t0)
	li $t4, 1
	sw $t4 0($t0)
	
	la $t0 hearts
	lw $t4 0($t0)
	li $t4, 3
	sw $t4 0($t0)
    	
    	j game_loop
    	
win_screen:
	la $t0 lvl
	lw $t4 0($t0)
	addi $t4, $t4, 1
	sw $t4 0($t0)
	
	beq $t4, 2, draw_lvl_2
	beq $t4, 3, draw_lvl_3
    	
    	li $t0, BASE_ADDRESS
    	li $t3, 0                # Initialize loop counter
    	la $t2, win_screen_array     
    	jal loop
    	
    	la $t0 dead
	lw $t4 0($t0)
	li $t4, 1
	sw $t4 0($t0)
	
	la $t0 hearts
	lw $t4 0($t0)
	li $t4, 3
	sw $t4 0($t0)
    	
    	j game_loop
