############# COLLISION ##################################
check_left_collision:
	la $t0, x   # top left on left side
    	lw $t2, 0($t0)
    	addi $t2, $t2, -2
    	sw $t2 0($t0)
    	move $a0, $t2
    	
    	la $t0, y
    	lw $t2, 0($t0)
    	addi $t2, $t2, 4
    	sw $t2 0($t0)
    	move $a1, $t2

    	jal get_x_y
    	
    	move $t0, $v0 
    	lw $t5, 0($t0) #get value of the pixel (hex code)
    	
    	la $t2, BACKGROUNDCOLOUR
    	lw $t6, 0($t2) #get the value of the background
	################
	la $t0, x   # left middle
    	lw $t2, 0($t0)
    	move $a0, $t2
    	
    	la $t0, y
    	lw $t2, 0($t0)
    	addi $t2, $t2, -2
    	sw $t2 0($t0)
    	move $a1, $t2

    	jal get_x_y
    	
    	move $t0, $v0 
    	lw $t7, 0($t0) #get value of the pixel (hex code) 
    	##########
	la $t0, x   # left outside of leg
    	lw $t2, 0($t0)
    	addi $t2, $t2, 1
    	sw $t2 0($t0)
    	move $a0, $t2
    	
    	la $t0, y
    	lw $t2, 0($t0)
    	addi $t2, $t2, -3
    	sw $t2 0($t0)
    	move $a1, $t2

    	jal get_x_y
    	
    	move $t0, $v0 
    	lw $t8, 0($t0) #get value of the pixel (hex code) 
	##############
	
	
    	la $t0, x
    	lw $t2, 0($t0)
    	addi $t2, $t2, 1 # get back to original value
    	sw $t2 0($t0)
    	
    	la $t0, y
    	lw $t2, 0($t0)
   	addi $t2, $t2, 1 # get back to original value
    	sw $t2 0($t0)

    	la $t0 left_collision
	lw $t2 0($t0)
    	bne $t5, $t6, set_collision #assumes the respective collision varaible is in $t2 - turn on collision for top left
    	bne $t7, $t6, set_collision #assumes the respective collision varaible is in $t2 - turn on collision for left middle
    	bne $t8, $t6, set_collision
    	beq $t5, $t6, move_left
    	beq $t7, $t6, move_left
    	beq $t8, $t6, move_left
	jr $ra
	
check_right_collision:
	la $t0, x   # top right on right side
    	lw $t2, 0($t0)
    	addi $t2, $t2, 5
    	sw $t2 0($t0)
    	move $a0, $t2
    	
    	la $t0, y
