	j game_loop

hanging:
	la $t0 is_jump
	lw $t2 0($t0)
	li $t2, 1
	sw $t2 0($t0)
	
	la $t0 height
	lw $t2 0($t0)
	beq $t2, 0, set_height_max #if not already in the air, set to max to start falling
	
	j game_loop
	
set_height_max:
	li $t2, 9
	sw $t2 0($t0)
	
	j game_loop

set_collision:
	li $t2, 1
	sw $t2 0($t0)
  	j game_loop
  	
set_jump_collision:
	li $t2, 1
	sw $t2 0($t0)
	
	la $t0 height  # reached a ceiling, max out height
	lw $t2 0($t0)
	li $t2, 9
	sw $t2 0($t0)
	
  	j game_loop
###############################################

################ KEYBOARD ######################
keypress_happened:
	lw $t7, 4($t9) # this assumes $t9 is set to 0xfff0000 from before
	beq $t7, 0x77, respond_to_w
	beq $t7, 0x61, respond_to_a  
	beq $t7, 0x64, respond_to_d
	beq $t7, 0x72, respond_to_r 
	beq $t7, 0x71, respond_to_q 
	j game_loop
	
respond_to_w:
	la $t0 lvl
	lw $t2 0($t0)
	beq $t2, 0, main
	
	la $t0 double_jump
	lw $t2 0($t0)
	
	beq $t2, 0, do_single_jump
	beq $t2 1, do_double_jump

    	j game_loop
	
do_single_jump:
	la $t0 double_jump  #set double_jump to 1
	lw $t2 0($t0)
	li $t2, 1
	sw $t2 0($t0)
	
	la $t0 jump_begin  #set jump_begin to 1
	lw $t2 0($t0)
	li $t2, 1
	sw $t2 0($t0)
	
	la $t3 is_jump
	lw $t2 0($t3)
	beq $t2, 0, set_jump_to_1 # if not jumping, start jumping

    	j game_loop
    	
do_double_jump:
	la $t0 height  #set height to 3 so jump is shorter
	lw $t2 0($t0)
	li $t2, 3
	sw $t2 0($t0)
	
	la $t0 jump_begin  #set jump_begin to 2
	lw $t2 0($t0)
	li $t2, 2
	sw $t2 0($t0)
	
	la $t0 double_jump  #set double_jump to 2
	lw $t2 0($t0)
	li $t2, 2
	sw $t2 0($t0)

    	j game_loop
    
set_jump_to_1:
	addi $t2, $t2, 1
	sw $t2 0($t3)  
	j game_loop
    	
respond_to_a:
	j check_left_collision
	
move_left:
	li $t2, 0
	sw $t2 0($t0)
	
	jal clear_cat
	
	la $t0 x
	lw $t2 0($t0)
	addi $t2, $t2, -1
	sw $t2 0($t0)

    
    	jal draw_cat_left
    	j check_hanging
    
respond_to_d:
	j check_right_collision 	
    			
move_right:
	li $t2, 0
	sw $t2 0($t0)
	
	jal clear_cat
	
	la $t0 x
	lw $t2 0($t0)
	addi $t2, $t2, 1
	sw $t2 0($t0)

    	jal draw_cat_right
    	
	j check_hanging

    
respond_to_r:
	jal clear_cat
	
	la $t0 dead
	lw $t3 0($t0)
	
	beq $t3, 1, reset_dead
	
	la $t0 lvl
	lw $t2 0($t0)
	
	beq $t2, 1, reset_1
	beq $t2, 2, reset_2
	beq $t2, 2, reset_3
	
	j main
	
reset_dead:
	la $t0 lvl
	lw $t2 0($t0)
	
	beq $t2, 1, reset_dead_1
	beq $t2, 2, reset_dead_2
	beq $t2, 3, reset_dead_3
	
reset_dead_1:
	la $t0, x #set x to the default value (4)
    	li $t1, 3
    	sw $t1, 0($t0)
   	la $t0, y #set y to the default value (6)
    	li $t1, 6
    	sw $t1, 0($t0)
    	
    	jal draw_lvl_1
    	jal draw_cat_right
	j stop_gravity
	
reset_dead_2:
	la $t0, x #set x to the default value (4)
    	li $t1, 4
    	sw $t1, 0($t0)
   	la $t0, y #set y to the default value (53)
    	li $t1, 54
    	sw $t1, 0($t0)
	
	jal draw_lvl_2
	jal draw_cat_right
	j stop_gravity	

reset_dead_3:
	la $t0, x #set x to the default value (9)
    	li $t1, 9
    	sw $t1, 0($t0)
   	la $t0, y #set y to the default value (6)
    	li $t1, 6
    	sw $t1, 0($t0)
	
	jal draw_lvl_3
	jal draw_cat_right
	j stop_gravity	
	
reset_1:
	la $t0, x #set x to the default value (3)
    	li $t1, 3
    	sw $t1, 0($t0)
   	la $t0, y #set y to the default value (6)
    	li $t1, 6
    	sw $t1, 0($t0)
    	
    	jal draw_cat_right
	j stop_gravity

reset_2:
	la $t0, x #set x to the default value (4)
    	li $t1, 4
    	sw $t1, 0($t0)
   	la $t0, y #set y to the default value (54)
    	li $t1, 54
    	sw $t1, 0($t0)
	
	jal draw_cat_right
	j stop_gravity
	
reset_3:
	la $t0, x #set x to the default value (9)
    	li $t1, 9
    	sw $t1, 0($t0)
   	la $t0, y #set y to the default value (6)
    	li $t1, 6
    	sw $t1, 0($t0)
	
	jal draw_cat_right
	j stop_gravity
	
respond_to_q:
	j exit
#########################################3
    
exit:
    li $v0, 10
    syscall


